import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import Cart from '../floatcart/components/Cart';

class Checkout extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Cart />
      </React.Fragment>
    )
  }
}

export default Checkout;
